css:
@-moz-document domain("myshows.me") {

.buttonPopup._download {
  background: #424242 url("data:image/png;base64,") no-repeat 50% 50%;
}

.status {
  background: #390 url("data:image/png;base64,") no-repeat 0 0;
}

.elementRate._compact > * {
  background: url("data:image/png;base64,") no-repeat -37px -37px;
}

.elementRate > :nth-child(6) {
  width: 30px;
  background-position: 2px -38px;
}

nav ul a::before {
  background: url("data:image/png;base64,") no-repeat 0 -88px;
}

.elementRate > * {
  background: url("data:image/png;base64,") no-repeat -37px -37px;
}

.stars {
  background: url("data:image/png;base64,") no-repeat -90px 0;
}
  
/*[[background]]*/
.content {
  background: #242424;
}

.showHeaderName, .showHeaderMeta {
  background: #242424;
}

.showHeader {
  border-bottom: 0px dotted #9c9b9b;
}

table.firmTable tr:nth-child(2n), .seasonBlockBody table tr:nth-child(1n) {
  /*border-bottom: 1px solid #6f6f6f;*/
}

table.firmTable tr:nth-child(2n), .seasonBlockBody table tr:nth-child(2n) {
  background: #303030;
  /*border-bottom: 1px solid #4b4b4b;*/
}
 /* 
.bss_seri {
	background-color: #161616;
  border-bottom: 1px solid #222;
}
*/
table.firmTable td:nth-child(3), .seasonBlockBody table td:nth-child(2) {
  max-width: 400px;
  white-space: pre;
  text-overflow: ellipsis;
  overflow: hidden;
}

.cFirm {
  color: #999 !important;
}

.buttonPopup a:hover, .headerUser > div > ul > li > a:hover, .jq-selectbox.lang-switcher li:hover {
  background: #515151;
}

.buttonPopup ul {
  background: #1A1A1A;
}

html:not(.touchSupported) .buttonPopup:hover, .buttonPopup._hover {
  background-color: #787878 !important;
}

a, .link {
  color: #d4d4d4;
}

h1, .h1 {
  color: #8c8c8c;
}

h2 a, h2, .h2, h4, .h4 {
  color: #fff;
}

h3, .h3 {
  color: #999999;
}

.content {
  color: #b7b5b5;
}

.showHeaderMeta {
  color: #ddd;
}

.cText {
  color: #aaa !important;
}

input[type="text"], input[type="search"], a.button {
  background-color: #a0a0a0;
}

.headerSearch input:focus + button {
  background-color: #7E7E7E;
}

.headerSearch button {
  background-color: #a0a0a0;
}

.searchSuggetions {
  color: #858585;
  background: #252525;
}

.buttonPopup._download._compact {
  background-size: auto;
  height: 22px;
  width: 22px;
  border-radius: 0.3em;
  padding: 6px 0;
}

.firmList li::before {
  color: #C3C3C3;
}

.seasonBlockHeader, .seasonBlockBody {
  border-bottom: 1px solid #4b4b4b;
}

.seasonBlockHeader:hover:after {
  border-color: #fff;
}

nav::before {
  background: #0c0c0c;
}

nav ul li._active {
  background: #4c4c4c;
}

nav ul a:hover {
  color: #E6E6E6;
}

._borderLeft[class^="col"]::before {
  border-left: 1px solid #484848;
}

nav ul a {
  border-bottom: 1px solid #484848;
}

nav .navAlert::before {
  border-top-color: #000;
  border-right-color: #000;
}

nav .navAlert {
  background: #000;
}

header {
  border-bottom: solid #454545 3px;
}

.labelPro {
  background: #787878;
}

nav ul li._active {
  color: #fff;
}

.commSign::before {
  border-top-color: #515151;
  border-right-color: #515151;
}

.commSign {
  color: #E0E0E0;
  background: #515151;
}

.commBlock._hint {
  background: none;
}

.infoList li:nth-child(2n) {
  background: #444444;
}

.linkPseudo {
  color: #b7b7b7;
}

.linkPseudo > span {
  border-bottom: 1px dashed #b7b7b7 !important;
}

.showProgress ._line {
  background: #8f8f8f;
}

.showProgress ._done {
  color: #ccc;
}

.calendar ._week ._d {
  color: #FFF;
}

.calendar ._d {
  color: #7A7A7A;
}

.statusBlock._type4 {
  color: #FFF;
}

.presentBlockBookmark._active, .mediaBlock ._bookmark._active {
  border-color: #868686;
}

.presentBlockBookmark:hover,.mediaBlock ._bookmark:hover {
  border-color: #ccc;
}

.labe {
  background: #868686;
}

.bcFirmB {
  background-color: #FFF !important;
}

.bcFirmB.labe {
  color: #000;
}

.iconEyeD {
  filter: grayscale(100%) invert(100%) brightness(175%) blur(0.3px);
}

.mediaBlock._withSideInfo ._body ._onImg {
  background: #6f6f6f;
}

.catalogTable th {
  border-bottom: 3px solid #fff;
}

.paginator li._active {
  background: #aaa;
}

a.linkBlock:hover .link, a.linkInlineBlock:hover .link {
  color: #fff !important;
}

.gallery._calendar .galleryControlLeft::before, .gallery._calendar .galleryControlRight::before {
  border-color: #898989;
}

.gallery._calendar .galleryControlLeft:hover::before, .gallery._calendar .galleryControlRight:hover::before {
	border-color: #e9e9e9;
}

.status._pro {
	filter: grayscale(100%) brightness(200%);
}

button, a.button {
	background-color: #3e3e3e;
}

.statusBlock, .statBlock, .commBlock ._contr, .jq-selectbox.lang-switcher {
  filter: grayscale(1);
}
/*[[dimpics]]*/
}
